Sure! Here's a simple JavaScript code that displays a greeting message in the browser console:

```javascript
// This script displays a greeting message in the console
console.log("Hello, world!");
```

If you want to display a message in an alert box on a webpage, you can use:

```javascript
// This script shows an alert box with a greeting message
alert("Hello, world!");
```

Let me know if you'd like a more specific example!
